import React from 'react';
import { Box, Typography } from '@material-ui/core';

const SectionHeading = () => {
    return (
        <>

            <Box py={2}>
                <Typography align="center" variant="h3">What Do We Offers</Typography>
                <Typography align="center" variant="subtitle1">Lorem ipsum dolor sit amet consectetur adipisicing elit. Soluta, voluptatum.</Typography>
            </Box>
        </>
    )
}

export default SectionHeading;
